import style from "./Popout_finalizar.module.css";



const Popout_finalizar = ()=>{
    return(
        <div id={style.PopoutContainer}>
            <div id={style.popout}>
                 <div>
                    <label>
                        ¿Como desea continuar su compra?
                    </label>
                </div>  
                <div>
                    <label>
                        <button id={style.logging}>Iniciar Sesión</button>
                    </label>       
                    <label>
                        <button id={style.ivited}>Como invitado</button>
                    </label>
                </div>
            </div>
        </div>
    )
};

export default Popout_finalizar;
